import React from 'react';
import emojis from '../emojis';

function Emojinote(props){
    return(
        <div>
            <p>{props.emoji}</p>
            <h1>{props.name}</h1>
            <p>{props.description}</p>
        </div>
    );
}

export default Emojinote;
